//WhitePlaysTop == 2 indicates white is at the top otherwise its at bottom
void Board::SetupBoard(bool WhitePlaysTop)
{
	int i;
	if (!WhitePlaysTop)
	{
		//white at bottom
		for (i=0; i<8; i++){
			boarddata[i][6] = 0x01; //white pawns
		}
		boarddata[0][7] = 0x02; //white queens rook
		boarddata[7][7] = 0x02; //white kings rook
		boarddata[1][7] = 0x03; //white queens knight
		boarddata[6][7] = 0x03; //white kings knight
		boarddata[2][7] = 0x04; //white queens bishop
		boarddata[5][7] = 0x04; //white kings bishop
		boarddata[3][7] = 0x05; //white queen
		boarddata[4][7] = 0x06; //white king

		//black at top
		for (i=0; i<8; i++){
			boarddata[i][1] = 0x8001; //black pawns
		}
		boarddata[0][0] = 0x8002; //black queens rook
		boarddata[7][0] = 0x8002; //black kings rook
		boarddata[1][0] = 0x8003; //black queens knight
		boarddata[6][0] = 0x8003; //black kings knight
		boarddata[2][0] = 0x8004; //black queens bishop
		boarddata[5][0] = 0x8004; //black kings bishop
		boarddata[3][0] = 0x8005; //black queen
		boarddata[4][0] = 0x8006; //black king

	}
	else
	{
		//white at top
		for (i=0; i<8; i++){
			boarddata[i][1] = 0x1; //white pawns
		}
		boarddata[0][0] = 0x2; //white queens rook
		boarddata[7][0] = 0x2; //white kings rook
		boarddata[1][0] = 0x3; //white queens knight
		boarddata[6][0] = 0x3; //white kings knight
		boarddata[2][0] = 0x4; //white queens bishop
		boarddata[5][0] = 0x4; //white kings bishop
		boarddata[3][0] = 0x5; //white queen
		boarddata[4][0] = 0x6; //white king

		//black at bottom
		for (i=0; i<8; i++){
			boarddata[i][6] = 0x8001; //black pawns
		}
		boarddata[0][7] = 0x8002; //black queens rook
		boarddata[7][7] = 0x8002; //black kings rook
		boarddata[1][7] = 0x8003; //black queens knight
		boarddata[6][7] = 0x8003; //black kings knight
		boarddata[2][7] = 0x8004; //black queens bishop
		boarddata[5][7] = 0x8004; //black kings bishop
		boarddata[3][7] = 0x8005; //black queen
		boarddata[4][7] = 0x8006; //black king

	}
}

void Board::RenderBoard()
{
	//render opaque tiles
	int x, y;
	SDL_Rect srcboardtile;
	SDL_Rect desttile;
	desttile.w = 36;
	desttile.h = 36;
	srcboardtile.w = 36;
	srcboardtile.h = 36;
	for (x=0; x<8; x++)
	{
		for (y=0; y<8; y++)
		{
			desttile.x = x * 36;
			desttile.y = y * 36;
			srcboardtile.x = 0;
			srcboardtile.y = 36 - ((x + y) * 36) % 72;
			envDrawImage(boardimage, &srcboardtile, &desttile);
		}
	}

	//Draw all pieces
	SDL_Rect piece;
	piece.w = 36;
	piece.h = 36;
	for (x=0; x<8; x++)
	{
		for (y=0; y<8; y++)
		{
			if (boarddata[x][y] != 0){
				piece.y = ((boarddata[x][y] & 0x8000) >> 15) * 36;   //based on team
				piece.x = (boarddata[x][y] & 0x1F) * 36;  //based on what piece type it is
				desttile.x = x * 36;
				desttile.y = y * 36;
				envDrawImage(boardimage, &piece, &desttile);
			}
		}
	}
}

void Board::LoadBoardImage()
{
	// load bitmap containing boarddata and pieces
	boardimage = SDL_CreateRGBSurface(SDL_SWSURFACE, 252, 72, 8, NULL, NULL, NULL, NULL);
	if (!boardimage)
	{
		printf("Error loading image data using SDL_CreateRGBSurface()");
	}

	//unpack the pallete arrays into an SDL_Color array
	cols = (SDL_Color*)malloc(sizeof(SDL_Color) * 256);
	for (int i=0; i<256; i++){
		cols[i].r = pallete_red[i];
		cols[i].g = pallete_green[i];
		cols[i].b = pallete_blue[i];
	}
	//set the palette colours to the surface
	if (!SDL_SetColors(boardimage, cols, 0, 256))
	{
		printf("Error setting image palette using SDL_SetColors()");
	}
	free(cols);

	//set image data
	SDL_LockSurface(boardimage);
	for (int i=0; i < boardimage->w * boardimage->h; i++)
	{
		Uint8* index = ((Uint8*)boardimage->pixels+i);
		*index = chessimagedata[i];
	}
	SDL_UnlockSurface(boardimage);
	
	// Set transparent colour key on surface
	Uint32 col = SDL_MapRGB(boardimage->format, 0, 255, 255); //cyan
	SDL_SetColorKey(boardimage, SDL_SRCCOLORKEY, col);

}